from typing import List

def separate_paren_groups(paren_string: str) -> List[str]:
    processed = paren_string.replace(' ', '')
    groups = []
    current_group = []
    balance = 0
    for char in processed:
        current_group.append(char)
        if char == '(':
            balance += 1
        else:
            balance -= 1
        if balance == 0:
            groups.append(''.join(current_group))
            current_group = []
    return groups
